import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import {Route, Routes} from "react-router-dom";
import FirstPage from "./components/createRouter/FirstPage";
import SecondPage from "./components/createRouter/SecondPage";
import ErrorPage from "./components/createRouter/ErrorPage";

const App = () => {
  return (
    <>
      <Routes>
        <Route exact  path='/' element={<FirstPage />}/>
        <Route exact  path='/second' element={<SecondPage />}/>
        <Route  element={<ErrorPage />}/>
      </Routes>
    </>
  )
}

export default App;
